import React from 'react';
import { add, sub, mul, div } from './Calc';
function App() {
  return (
    <>
    <ul>
        <li> {add(20, 10)}</li>
        <li> {sub(20, 10)}</li>
        <li> {mul(20, 10)}</li>
        <li> {div(20, 10)}</li>
      </ul>
    </>
  );

}

export default App;
